import { MenuEntry } from '@pancakeswap-libs/uikit'

const config: MenuEntry[] = [
  {
    label: 'Home',
    icon: 'HomeIcon',
    href: '/',
  },
  {
    label: 'Trade',
    icon: 'TradeIcon',
    items: [
      {
        label: 'Buy',
        href: '/buy',
      },
      {
        label: 'Liquidity',
        href: '/liquidity',
      },
    ],
  },
  {
    label: 'Farms',
    icon: 'FarmIcon',
    href: '/farms',
  },
  {
    label: 'Pools',
    icon: 'PoolIcon',
    href: '/pools',
  },

  {
    label: 'Jungle Pools',
    icon: 'PoolIcon',
    href: '/junglepools',
  },
  {
    label: 'NFT Marketplace',
    icon: 'NftIcon',
    href: '/nft',
  },
 
  {
    label: 'Info',
    icon: 'InfoIcon',
    items: [
      {
        label: 'QuickSwap Chart',
        href: 'https://info.quickswap.exchange/token/0xb3694901fCa2376c40986c1bf5ffdf8781f49389',
      },
      {
        label: 'Polygon Explorer',
        href: 'https://explorer-mainnet.maticvigil.com/tokens/0xb3694901fCa2376c40986c1bf5ffdf8781f49389',
      },
      {
        label: 'SALSA Chart',
        href: 'https://quickchart.app/token/0xb3694901fCa2376c40986c1bf5ffdf8781f49389'
      }
    ],
  },
  {
    label: 'More',
    icon: 'MoreIcon',
    items: [
      {
        label: "Github",
        href: "https://github.com/salsa",
      },
      {
        label: "Blog",
        href: "https://salsa.medium.com",
      },
      {
        label: "Docs",
        href: "https://docs.salsa.finance/",
      },
    ],
  },
  {
    label: "Roadmap",
    icon: "RoadmapIcon",
    href: 'https://docs.salsa.finance/roadmap',
  },
  {
    label: "Collab",
    icon: "HandshakeIcon",
    href: 'https://t.me/salsa',
  }
]

export default config
